'use strict';

var VariablePage = require('../models/pages/VariablePage.js');

const variablePage = async ({ page, selectors, grafanaVersion, request }, use, testInfo) => {
  const variablePage2 = new VariablePage.VariablePage({ page, selectors, grafanaVersion, request, testInfo });
  await variablePage2.goto();
  await use(variablePage2);
};

exports.variablePage = variablePage;
